import React from "react";
import {
  FormControl,
  // Menu,
  Text,
  Select,
  FormLabel,
  Flex,
  Box,
} from "@chakra-ui/react";

const FilterComponent = () => {
  return (
    <>
      <Box>
        <SortComponent />
      </Box>
    </>
  );
};

export default FilterComponent;

const SortComponent = () => {
  return (
    <>
      <Box>
        
      </Box>
        <FormControl>
          <Box>Sort By :</Box>
          <Select>
            <option> High to Low</option>
            <option> Low to High</option>
            <option>Rating</option>
          </Select>
        </FormControl>
      
    </>
  );
};
